    }
    return new ArrayList<>(pasteContentHolder);
  }
  /** 
 * 是否包含拷贝步骤
 * @return
 */
  public static boolean containsPasteContent(){
    return pasteContentHolder != null;
  }
  /** 
 * 获取用例
 * @param id
 * @return
 */
  public static RecordCaseInfo getCase(  int id){
    return caseHolder.remove(id);
  }
  /** 
 * 暂存结果
