public class SecurityConfiguration {
  public static final ConfigOption<String> KERBEROS_LOGIN_KEYTAB=key("security.kerberos.login.keytab").stringType().noDefaultValue().withDeprecatedKeys("security.keytab").withDescription("Absolute path to a Kerberos keytab file that contains the user credentials.");
  public static final ConfigOption<String> KERBEROS_LOGIN_PRINCIPAL=key("security.kerberos.login.principal").stringType().noDefaultValue().withDeprecatedKeys("security.principal").withDescription("Kerberos principal name associated with the keytab.");
  public static final ConfigOption<Boolean> KERBEROS_LOGIN_USETICKETCACHE=key("security.kerberos.login.use-ticket-cache").booleanType().defaultValue(true).withDescription("Indicates whether to read from your Kerberos ticket cache.");
  private final Options options;
  private final boolean useTicketCache;
  private final String keytab;
  private final String principal;
  public SecurityConfiguration(  Options options){
    this.options=checkNotNull(options);
    this.keytab=options.get(KERBEROS_LOGIN_KEYTAB);
    this.principal=options.get(KERBEROS_LOGIN_PRINCIPAL);
    this.useTicketCache=options.get(KERBEROS_LOGIN_USETICKETCACHE);
  }
  public String getKeytab(){
    return keytab;
  }
  public String getPrincipal(){
    return principal;
  }
  public boolean useTicketCache(){
    return useTicketCache;
  }
  public Options getOptions(){
    return options;
  }
  public boolean isLegal(){
    if (StringUtils.isBlank(keytab) != StringUtils.isBlank(principal)) {
      return false;
    }
    if (!StringUtils.isBlank(keytab)) {
      File keytabFile=new File(keytab);
      return keytabFile.exists() && keytabFile.isFile() && keytabFile.canRead();
    }
    return true;
  }
}
