@Mixin(Boat.class) public abstract class BoatMixin extends VehicleEntityMixin {
  public double maxSpeed=0.4D;
  public double occupiedDeceleration=0.2D;
  public double unoccupiedDeceleration=-1;
  public boolean landBoats=false;
  private Location lastLocation;
  @Inject(method="push",cancellable=true,at=@At(value="INVOKE",target="Lnet/minecraft/world/entity/vehicle/VehicleEntity;push(Lnet/minecraft/world/entity/Entity;)V")) private void arclight$collideVehicle(  Entity entityIn,  CallbackInfo ci){
    if (isPassengerOfSameVehicle(entityIn)) {
      VehicleEntityCollisionEvent event=new VehicleEntityCollisionEvent((Vehicle)this.getBukkitEntity(),((EntityBridge)entityIn).bridge$getBukkitEntity());
      Bukkit.getPluginManager().callEvent(event);
      if (event.isCancelled()) {
        ci.cancel();
      }
    }
  }
  @Inject(method="tick",at=@At(value="INVOKE",target="Lnet/minecraft/world/entity/vehicle/Boat;tickBubbleColumn()V")) private void arclight$updateVehicle(  CallbackInfo ci){
    final org.bukkit.World bworld=this.level().bridge$getWorld();
    final Location to=new Location(bworld,this.getX(),this.getY(),this.getZ(),this.getYRot(),this.getXRot());
    final Vehicle vehicle=(Vehicle)this.getBukkitEntity();
