@Configuration @ConditionalOnProperty(value="cors.enabled",matchIfMissing=true) public class CorsConfiguration {
  @Value("${cors.allowOrigins:*}") private String corsAllowOrigins;
  @Value("${cors.allowMethods:GET,POST,PUT,DELETE}") private String corsAllowMethods;
  @Value("${cors.maxAge:3600}") private String corsMaxAge;
  @Value("${cors.allowCredentials:true}") private String corsAllowCredentials;
  @Value("${cors.allowHeaders:Origin,Accept,X-Requested-With,Content-Type,Access-Control-Request-Method," + "Access-Control-Request-Headers,Authorization}") private String corsAllowHeaders;
  @Bean @Order(Ordered.HIGHEST_PRECEDENCE) public Filter corsFilter(){
    return new Filter(){
      @Override public void init(      FilterConfig filterConfig){
      }
      @Override public void doFilter(      ServletRequest req,      ServletResponse res,      FilterChain chain) throws IOException, ServletException {
        final var response=(HttpServletResponse)res;
        final var request=(HttpServletRequest)req;
        response.setHeader("Access-Control-Allow-Origin",corsAllowOrigins);
        response.setHeader("Access-Control-Allow-Methods",corsAllowMethods);
        response.setHeader("Access-Control-Max-Age",corsMaxAge);
        response.setHeader("Access-Control-Allow-Credentials",corsAllowCredentials);
        response.setHeader("Access-Control-Allow-Headers",corsAllowHeaders);
        if (request.getMethod().equals(HttpMethod.OPTIONS.name())) {
          response.setStatus(HttpStatus.NO_CONTENT.value());
        }
 else {
          chain.doFilter(req,res);
        }
      }
      @Override public void destroy(){
      }
    }
;
  }
}
