    for (    var c : CacheConsts.CacheEnum.values()) {
      if (c.isLocal()) {
        Caffeine<Object,Object> caffeine=Caffeine.newBuilder().recordStats().maximumSize(c.getMaxSize());
        if (c.getTtl() > 0) {
          caffeine.expireAfterWrite(Duration.ofSeconds(c.getTtl()));
        }
        caches.add(new CaffeineCache(c.getName(),caffeine.build()));
      }
    }
    cacheManager.setCaches(caches);
    return cacheManager;
  }
  /** 
 * Redis 缓存管理器
 */
  @Bean public CacheManager redisCacheManager(  RedisConnectionFactory connectionFactory){
    RedisCacheWriter redisCacheWriter=RedisCacheWriter.nonLockingRedisCacheWriter(connectionFactory);
    RedisCacheConfiguration defaultCacheConfig=RedisCacheConfiguration.defaultCacheConfig().disableCachingNullValues().prefixCacheNameWith(CacheConsts.REDIS_CACHE_PREFIX);
    Map<String,RedisCacheConfiguration> cacheMap=new LinkedHashMap<>(CacheConsts.CacheEnum.values().length);
    for (    var c : CacheConsts.CacheEnum.values()) {
      if (c.isRemote()) {
        if (c.getTtl() > 0) {
          cacheMap.put(c.getName(),RedisCacheConfiguration.defaultCacheConfig().disableCachingNullValues().prefixCacheNameWith(CacheConsts.REDIS_CACHE_PREFIX).entryTtl(Duration.ofSeconds(c.getTtl())));
        }
 else {
          cacheMap.put(c.getName(),RedisCacheConfiguration.defaultCacheConfig().disableCachingNullValues().prefixCacheNameWith(CacheConsts.REDIS_CACHE_PREFIX));
        }
      }
    }
    RedisCacheManager redisCacheManager=new RedisCacheManager(redisCacheWriter,defaultCacheConfig,cacheMap);
    redisCacheManager.setTransactionAware(true);
    redisCacheManager.initializeCaches();
    return redisCacheManager;
  }
}
