  private InputStream _is;
  private int _length;
  private boolean _isPacketEnd;
  StreamingInputStream(  InputStream is){
    _is=is;
  }
  public boolean isDataAvailable(){
    try {
      return _is != null && _is.available() > 0;
    }
 catch (    IOException e) {
      log.log(Level.FINER,e.toString(),e);
      return true;
    }
  }
  public boolean startPacket() throws IOException {
    do {
      _isPacketEnd=false;
    }
 while ((_length=readChunkLength(_is)) == 0);
    return _length > 0;
  }
  public void endPacket() throws IOException {
    while (!_isPacketEnd) {
      if (_length <= 0)       _length=readChunkLength(_is);
      if (_length > 0) {
        _is.skip(_length);
        _length=0;
      }
    }
    if (_length > 0) {
      _is.skip(_length);
      _length=0;
    }
  }
  public int read() throws IOException {
    InputStream is=_is;
    if (_length == 0) {
      if (_isPacketEnd)       return -1;
      _length=readChunkLength(is);
      if (_length <= 0)       return -1;
    }
    _length--;
    return is.read();
  }
  @Override public int read(  byte[] buffer,  int offset,  int length) throws IOException {
    InputStream is=_is;
    if (_length <= 0) {
      if (_isPacketEnd)       return -1;
      _length=readChunkLength(is);
      if (_length <= 0)       return -1;
    }
    int sublen=_length;
    if (length < sublen)     sublen=length;
    sublen=is.read(buffer,offset,sublen);
    if (sublen < 0)     return -1;
    _length-=sublen;
    return sublen;
  }
  private int readChunkLength(  InputStream is) throws IOException {
    if (_isPacketEnd)     return -1;
    int length=0;
    int code=is.read();
    if (code < 0) {
      _isPacketEnd=true;
      return -1;
    }
    _isPacketEnd=(code & 0x80) == 0;
    int len=is.read() & 0x7f;
    if (len < 0x7e) {
      length=len;
    }
 else     if (len == 0x7e) {
      length=(((is.read() & 0xff) << 8) + (is.read() & 0xff));
    }
 else {
      length=(((is.read() & 0xff) << 56) + ((is.read() & 0xff) << 48) + ((is.read() & 0xff) << 40)+ ((is.read() & 0xff) << 32)+ ((is.read() & 0xff) << 24)+ ((is.read() & 0xff) << 16)+ ((is.read() & 0xff) << 8)+ ((is.read() & 0xff)));
    }
    return length;
  }
}
