private static class UserSortComparator implements Comparator<UserEntity> {
  private static final int LESSER=-1;
  private static final int EQUAL=0;
  private static final int GREATER=1;
  /** 
 * Sorting priority: 1. Selected user; 2. Screen sharing user; 3. Room owner; 4. Myself; 5. User has camera and audio; 6. User has camera; 7. User has audio;
 */
  @Override public int compare(  UserEntity o1,  UserEntity o2){
    if (o1 == null || o2 == null) {
      return EQUAL;
    }
    if (o1.isSelected()) {
      return LESSER;
    }
    if (o2.isSelected()) {
      return GREATER;
    }
    if (o1.isScreenShareAvailable()) {
      return LESSER;
    }
    if (o2.isScreenShareAvailable()) {
      return GREATER;
    }
    if (o1.getRole() == TUIRoomDefine.Role.ROOM_OWNER) {
      return LESSER;
    }
    if (o2.getRole() == TUIRoomDefine.Role.ROOM_OWNER) {
      return GREATER;
    }
    if (o1.isSelf()) {
      return LESSER;
    }
    if (o2.isSelf()) {
      return GREATER;
    }
    if (o1.isCameraAvailable() != o2.isCameraAvailable()) {
      return o1.isCameraAvailable() ? LESSER : GREATER;
    }
    if (o1.isAudioAvailable() != o2.isAudioAvailable()) {
      return o1.isAudioAvailable() ? LESSER : GREATER;
    }
    return EQUAL;
  }
}
