@Contract(threading=ThreadingBehavior.SAFE) private static final class MapAuthCache implements AuthCache {
  private final Map<HttpHost,AuthScheme> map;
  private final SchemePortResolver schemePortResolver;
  MapAuthCache(){
    this(DefaultSchemePortResolver.INSTANCE);
  }
  MapAuthCache(  SchemePortResolver schemePortResolver){
    this.map=new ConcurrentHashMap<>();
    this.schemePortResolver=schemePortResolver;
  }
  @Override public void put(  final HttpHost host,  final AuthScheme authScheme){
    Args.notNull(host,"HTTP host");
    if (authScheme == null) {
      return;
    }
    map.put(getKey(host),authScheme);
  }
  @Override public AuthScheme get(  final HttpHost host){
    Args.notNull(host,"HTTP host");
    return map.get(getKey(host));
  }
  @Override public void remove(  final HttpHost host){
    Args.notNull(host,"HTTP host");
    map.remove(getKey(host));
  }
  @Override public void clear(){
    map.clear();
  }
  @Override public String toString(){
    return map.toString();
  }
  private HttpHost getKey(  final HttpHost host){
    if (host.getPort() <= 0) {
      final int port;
      try {
        port=schemePortResolver.resolve(host);
      }
 catch (      final UnsupportedSchemeException ignore) {
        return host;
      }
      return new HttpHost(host.getHostName(),port,host.getSchemeName());
    }
 else {
      return host;
    }
  }
}
