    XLog.d("Row apk path: %s",rowApkPath);
    if (rowApkPath != null) {
      return getThanox(rowApkPath);
    }
    File prcApkPath=PackageUtils.getApkPath("github.tornaco.android.thanos");
    XLog.d("Prc apk path: %s",prcApkPath);
