/** 
 * {@code SparseMax} contains a generic implementation of sparsemax function the definition ofSparseMax can be referred to https://arxiv.org/pdf/1602.02068.pdf.  {@code SparseMax} is a simplerimplementation of sparseMax function, where we set K as a hyperParameter(default 3). We only do softmax on those max-K data, and we set all the other value as 0.
 */
public class SparseMax extends AbstractBlock {
  private static final Byte VERSION=1;
  private int axis;
  private int topK;
  /** 
 * Creates a sparseMax activation function for the last axis and 3 elements. 
 */
  public SparseMax(){
    this(-1,3);
  }
  /** 
 * Creates a sparseMax activation function along a given axis for 3 elements.
 * @param axis the axis to do sparseMax for
 */
  public SparseMax(  int axis){
    this(axis,3);
  }
  /** 
 * Creates a sparseMax activation function along a given axis and number of elements.
 * @param axis the axis to do sparseMax for
 * @param topK hyperParameter K
 */
  public SparseMax(  int axis,  int topK){
    super(VERSION);
    this.axis=axis;
    this.topK=topK;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public Shape[] getOutputShapes(  Shape[] inputShapes){
    return new Shape[]{inputShapes[0]};
  }
  /** 
 * {@inheritDoc} 
 */
  @Override protected NDList forwardInternal(  ParameterStore parameterStore,  NDList inputs,  boolean training,  PairList<String,Object> params){
    NDArray input=inputs.singletonOrThrow();
    if (axis != -1) {
      input=input.swapAxes(axis,-1);
    }
    NDArray level=input.argSort(-1,false).toType(DataType.INT64,false);
    int lastDimSize=(int)input.size(input.getShape().dimension() - 1);
    NDArray maskTopK=NDArrays.add(IntStream.range(0,topK).mapToObj(j -> level.get("..., {}",j).oneHot(lastDimSize)).toArray(NDArray[]::new));
    NDArray expSum=input.exp().mul(maskTopK).sum(new int[]{-1},true).broadcast(input.getShape());
    NDArray output=input.exp().mul(maskTopK).div(expSum);
    if (axis != -1) {
      output=output.swapAxes(axis,-1);
    }
    return new NDList(output);
  }
}
