public class DeviceUtils {
  public static void setScreenLockParams(  Window window){
    if (null == window) {
      return;
    }
    PowerManager powerManager=(PowerManager)window.getContext().getSystemService(Context.POWER_SERVICE);
    boolean isScreenOn=powerManager.isScreenOn();
    if (isScreenOn) {
      window.addFlags(WindowManager.LayoutParams.FLAG_SHOW_WHEN_LOCKED | WindowManager.LayoutParams.FLAG_DISMISS_KEYGUARD | WindowManager.LayoutParams.FLAG_KEEP_SCREEN_ON);
    }
 else {
      window.addFlags(WindowManager.LayoutParams.FLAG_SHOW_WHEN_LOCKED | WindowManager.LayoutParams.FLAG_DISMISS_KEYGUARD | WindowManager.LayoutParams.FLAG_KEEP_SCREEN_ON| WindowManager.LayoutParams.FLAG_TURN_SCREEN_ON);
    }
  }
  public static int getScreenWidth(  Context context){
    DisplayMetrics metric=new DisplayMetrics();
    WindowManager wm=(WindowManager)context.getSystemService(Context.WINDOW_SERVICE);
    wm.getDefaultDisplay().getMetrics(metric);
    return metric.widthPixels;
  }
  public static int getScreenHeight(  Context context){
    DisplayMetrics metric=new DisplayMetrics();
    WindowManager wm=(WindowManager)context.getSystemService(Context.WINDOW_SERVICE);
    wm.getDefaultDisplay().getMetrics(metric);
    return metric.heightPixels;
  }
  public static boolean isAppRunningForeground(  Context context){
    ActivityManager activityManager=(ActivityManager)context.getSystemService(Context.ACTIVITY_SERVICE);
    List<ActivityManager.RunningAppProcessInfo> runningAppProcessInfos=activityManager.getRunningAppProcesses();
    if (runningAppProcessInfos == null) {
      return false;
    }
    String packageName=context.getPackageName();
    for (    ActivityManager.RunningAppProcessInfo appProcessInfo : runningAppProcessInfos) {
      if (appProcessInfo.importance == ActivityManager.RunningAppProcessInfo.IMPORTANCE_FOREGROUND && appProcessInfo.processName.equals(packageName)) {
        return true;
      }
    }
    return false;
  }
  public static boolean isServiceRunning(  Context context,  String className){
    if (context == null || TextUtils.isEmpty(className)) {
      return false;
    }
    ActivityManager am=(ActivityManager)context.getSystemService(Context.ACTIVITY_SERVICE);
    List<ActivityManager.RunningServiceInfo> info=am.getRunningServices(0x7FFFFFFF);
    if (info == null || info.size() == 0) {
      return false;
    }
    for (    ActivityManager.RunningServiceInfo aInfo : info) {
      if (className.equals(aInfo.service.getClassName())) {
        return true;
      }
    }
    return false;
  }
