public class KeepClassMemberChecker {
  private final WarningPrinter notePrinter;
  /** 
 * Creates a new KeepClassMemberChecker.
 */
  public KeepClassMemberChecker(  WarningPrinter notePrinter){
    this.notePrinter=notePrinter;
  }
  /** 
 * Checks if the given class specifications try to keep class members without actually specifying any, printing notes if necessary.
 */
  public void checkClassSpecifications(  List keepClassSpecifications){
    if (keepClassSpecifications != null) {
      for (int index=0; index < keepClassSpecifications.size(); index++) {
        KeepClassSpecification keepClassSpecification=(KeepClassSpecification)keepClassSpecifications.get(index);
        if (!keepClassSpecification.markClasses && (keepClassSpecification.fieldSpecifications == null || keepClassSpecification.fieldSpecifications.size() == 0) && (keepClassSpecification.methodSpecifications == null || keepClassSpecification.methodSpecifications.size() == 0)) {
          String className=keepClassSpecification.className;
          if (className == null) {
            className=keepClassSpecification.extendsClassName;
          }
          if (className == null || notePrinter.accepts(className)) {
            notePrinter.print(className,"Note: the configuration doesn't specify which class members to keep for class '" + (className == null ? ConfigurationConstants.ANY_CLASS_KEYWORD : ClassUtil.externalClassName(className)) + "'");
          }
        }
      }
    }
  }
