/** 
 * A featurizer implemented for feature of date type using epoch day (number of days since 1970-01-01).
 */
private static final class EpochDayFeaturizer implements Featurizer {
  String datePattern;
  /** 
 * Constructs a  {@code EpochDayFeaturizer}.
 * @param datePattern the pattern that dates are found in the data table column
 */
  EpochDayFeaturizer(  String datePattern){
    this.datePattern=datePattern;
  }
  /** 
 * Featurize the feature of date type to epoch day (the number of days passed since 1970-01-01) and put it into float buffer, so that it can be used for future training in a simple way.
 * @param buf the float buffer to be filled
 * @param input the date string in the format {@code yyyy-MM-dd}
 */
  @Override public void featurize(  DynamicBuffer buf,  String input){
    LocalDate ld=LocalDate.parse(input,DateTimeFormatter.ofPattern(datePattern));
    long day=ld.toEpochDay();
    buf.put(day);
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public int dataRequired(){
    return 1;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public Object deFeaturize(  float[] data){
    return LocalDate.ofEpochDay(Math.round(data[0]));
  }
}
