  @Resource @Lazy private TradeOrderUpdateService orderUpdateService;
  @Resource private TradeOrderQueryService orderQueryService;
  @Resource @Lazy private CombinationRecordApi combinationRecordApi;
  @Override public void beforeOrderCreate(  TradeOrderDO order,  List<TradeOrderItemDO> orderItems){
    if (!TradeOrderTypeEnum.isCombination(order.getType())) {
      return;
    }
    Assert.isTrue(orderItems.size() == 1,"拼团时，只允许选择一个商品");
    TradeOrderItemDO item=orderItems.get(0);
    combinationRecordApi.validateCombinationRecord(order.getUserId(),order.getCombinationActivityId(),order.getCombinationHeadId(),item.getSkuId(),item.getCount()).checkError();
    TradeOrderDO activityOrder=orderQueryService.getOrderByUserIdAndStatusAndCombination(order.getUserId(),order.getCombinationActivityId(),TradeOrderStatusEnum.UNPAID.getStatus());
    if (activityOrder != null) {
      throw exception(ORDER_CREATE_FAIL_EXIST_UNPAID);
    }
  }
  @Override public void afterPayOrder(  TradeOrderDO order,  List<TradeOrderItemDO> orderItems){
    if (!TradeOrderTypeEnum.isCombination(order.getType())) {
      return;
    }
    Assert.isTrue(orderItems.size() == 1,"拼团时，只允许选择一个商品");
    TradeOrderItemDO item=orderItems.get(0);
    CombinationRecordCreateRespDTO combinationRecord=combinationRecordApi.createCombinationRecord(TradeOrderConvert.INSTANCE.convert(order,item)).getCheckedData();
    orderUpdateService.updateOrderCombinationInfo(order.getId(),order.getCombinationActivityId(),combinationRecord.getCombinationRecordId(),combinationRecord.getCombinationHeadId());
  }
  @Override public void beforeDeliveryOrder(  TradeOrderDO order){
    if (!TradeOrderTypeEnum.isCombination(order.getType())) {
      return;
    }
    CombinationRecordRespDTO combinationRecord=combinationRecordApi.getCombinationRecordByOrderId(order.getUserId(),order.getId()).getCheckedData();
    Assert.notNull(combinationRecord,"订单({})对应的拼团记录不存在",order.getId());
    if (!CombinationRecordStatusEnum.isSuccess(combinationRecord.getStatus())) {
      throw exception(ORDER_DELIVERY_FAIL_COMBINATION_RECORD_STATUS_NOT_SUCCESS);
    }
  }
}
