 * 监听  {@link Task} 的开始与完成
 * @author jason
 */
@Component @Slf4j public class BpmTaskEventListener extends AbstractFlowableEngineEventListener {
  @Resource @Lazy private BpmModelService modelService;
  @Resource @Lazy private BpmTaskService taskService;
  public static final Set<FlowableEngineEventType> TASK_EVENTS=ImmutableSet.<FlowableEngineEventType>builder().add(FlowableEngineEventType.TASK_CREATED).add(FlowableEngineEventType.TASK_ASSIGNED).add(FlowableEngineEventType.ACTIVITY_CANCELLED).add(FlowableEngineEventType.TIMER_FIRED).build();
  public BpmTaskEventListener(){
    super(TASK_EVENTS);
  }
  @Override protected void taskCreated(  FlowableEngineEntityEvent event){
    taskService.processTaskCreated((Task)event.getEntity());
  }
  @Override protected void taskAssigned(  FlowableEngineEntityEvent event){
    taskService.processTaskAssigned((Task)event.getEntity());
  }
  @Override protected void activityCancelled(  FlowableActivityCancelledEvent event){
    List<HistoricActivityInstance> activityList=taskService.getHistoricActivityListByExecutionId(event.getExecutionId());
    if (CollUtil.isEmpty(activityList)) {
      log.error("[activityCancelled][使用 executionId({}) 查找不到对应的活动实例]",event.getExecutionId());
      return;
    }
    activityList.forEach(activity -> {
      if (StrUtil.isEmpty(activity.getTaskId())) {
        return;
      }
      taskService.processTaskCanceled(activity.getTaskId());
    }
);
  }
  @Override @SuppressWarnings("PatternVariableCanBeUsed") protected void timerFired(  FlowableEngineEntityEvent event){
    String processDefinitionId=event.getProcessDefinitionId();
    BpmnModel bpmnModel=modelService.getBpmnModelByDefinitionId(processDefinitionId);
    Job entity=(Job)event.getEntity();
    FlowElement element=BpmnModelUtils.getFlowElementById(bpmnModel,entity.getElementId());
    if (!(element instanceof BoundaryEvent)) {
      return;
    }
    BoundaryEvent boundaryEvent=(BoundaryEvent)element;
    String boundaryEventType=BpmnModelUtils.parseBoundaryEventExtensionElement(boundaryEvent,BpmnModelConstants.BOUNDARY_EVENT_TYPE);
    BpmBoundaryEventTypeEnum bpmTimerBoundaryEventType=BpmBoundaryEventTypeEnum.typeOf(NumberUtils.parseInt(boundaryEventType));
    if (ObjectUtil.equal(bpmTimerBoundaryEventType,BpmBoundaryEventTypeEnum.USER_TASK_TIMEOUT)) {
      String timeoutHandlerType=BpmnModelUtils.parseBoundaryEventExtensionElement(boundaryEvent,BpmnModelConstants.USER_TASK_TIMEOUT_HANDLER_TYPE);
      String taskKey=boundaryEvent.getAttachedToRefId();
      taskService.processTaskTimeout(event.getProcessInstanceId(),taskKey,NumberUtils.parseInt(timeoutHandlerType));
    }
 else     if (ObjectUtil.equal(bpmTimerBoundaryEventType,BpmBoundaryEventTypeEnum.DELAY_TIMER_TIMEOUT)) {
      String taskKey=boundaryEvent.getAttachedToRefId();
      taskService.processDelayTimerTimeout(event.getProcessInstanceId(),taskKey);
    }
  }
}
