@Slf4j @Service @RequiredArgsConstructor @Transactional(propagation=Propagation.SUPPORTS,readOnly=true,rollbackFor=Exception.class) public class ExternalLinkServiceImpl extends ServiceImpl<ExternalLinkMapper,ExternalLink> implements ExternalLinkService {
  private final FlinkApplicationManageService applicationManageService;
  @Override public void create(  ExternalLink externalLink){
    if (this.check(externalLink)) {
      return;
    }
    externalLink.setId(null);
    this.save(externalLink);
  }
  @Override public void update(  ExternalLink externalLink){
    if (this.check(externalLink)) {
      return;
    }
    baseMapper.updateById(externalLink);
  }
  @Override public void removeById(  Long linkId){
    baseMapper.deleteById(linkId);
  }
  @Override public List<ExternalLink> render(  Long appId){
    FlinkApplication app=applicationManageService.getById(appId);
    AssertUtils.notNull(app,"Application doesn't exist");
    List<ExternalLink> externalLink=this.list();
    if (externalLink != null && externalLink.size() > 0) {
      externalLink.forEach(link -> this.renderLinkUrl(link,app));
    }
    return externalLink;
  }
  private void renderLinkUrl(  ExternalLink link,  FlinkApplication app){
    Map<String,String> placeholderValueMap=new HashMap<>();
    placeholderValueMap.put(PlaceholderTypeEnum.ID.get(),String.valueOf(app.getId()));
    placeholderValueMap.put(PlaceholderTypeEnum.JOB_ID.get(),app.getJobId());
    placeholderValueMap.put(PlaceholderTypeEnum.JOB_NAME.get(),app.getJobName());
    placeholderValueMap.put(PlaceholderTypeEnum.YARN_ID.get(),app.getClusterId());
    PropertyPlaceholderHelper propertyPlaceholderHelper=new PropertyPlaceholderHelper("{","}");
    link.setRenderedLinkUrl(propertyPlaceholderHelper.replacePlaceholders(link.getLinkUrl().trim(),placeholderValueMap::get));
  }
  private boolean check(  ExternalLink params){
    ExternalLink result=this.lambdaQuery().nested(qw -> qw.eq(ExternalLink::getBadgeName,params.getBadgeName()).or().eq(ExternalLink::getLinkUrl,params.getLinkUrl())).and(params.getId() != null,qw -> qw.ne(ExternalLink::getId,params.getId())).one();
    if (result == null) {
      return false;
    }
    ApiAlertException.throwIfTrue(result.getBadgeName().equals(params.getBadgeName()),String.format("The name: %s is already existing.",result.getBadgeName()));
    ApiAlertException.throwIfTrue(result.getLinkUrl().equals(params.getLinkUrl()),String.format("The linkUrl: %s is already existing.",result.getLinkUrl()));
    return true;
  }
}
