public abstract class HttpService {
  public static URI safeURI(  HttpRequest request){
    try {
      return request.getUri();
    }
 catch (    URISyntaxException e1) {
      return URI.create(request.getRequestUri());
    }
  }
  public static HttpHeaders toHttpHeaders(  @Nullable Header[] headers){
    if (headers == null) {
      return null;
    }
    return HttpHeaders.of(Arrays.stream(headers).collect(Collectors.groupingBy((header) -> header.getName().toLowerCase(Locale.ROOT),Collectors.mapping(NameValuePair::getValue,Collectors.toList()))),(s,s2) -> true);
  }
  public static HttpEntityCopy copy(  final HttpEntity entity) throws IOException {
    final ByteArrayOutputStream os=new ByteArrayOutputStream();
    entity.writeTo(os);
    final byte[] body=os.toByteArray();
    ContentType contentType=ContentType.parse(entity.getContentType());
    boolean chunked=entity.isChunked();
    String contentEncoding=entity.getContentEncoding();
    final ByteArrayEntity copy=new ByteArrayEntity(body,contentType,contentEncoding,chunked);
    return new HttpEntityCopy(copy,body);
  }
@RequiredArgsConstructor public static final class HttpEntityCopy implements HttpEntity {
    @Delegate private final HttpEntity entity;
    @Getter private final byte[] body;
  }
}
