static final class MarshalOutputStream extends ObjectOutputStream {
  private URL sendUrl;
  public MarshalOutputStream(  OutputStream out,  URL u) throws IOException {
    super(out);
    this.sendUrl=u;
  }
  MarshalOutputStream(  OutputStream out) throws IOException {
    super(out);
  }
  @Override protected void annotateClass(  Class<?> cl) throws IOException {
    if (this.sendUrl != null) {
      writeObject(this.sendUrl.toString());
    }
 else     if (!(cl.getClassLoader() instanceof URLClassLoader)) {
      writeObject(null);
    }
 else {
      URL[] us=((URLClassLoader)cl.getClassLoader()).getURLs();
      String cb="";
      for (      URL u : us) {
        cb+=u.toString();
      }
      writeObject(cb);
    }
  }
  /** 
 * Serializes a location from which to load the specified class.
 */
  @Override protected void annotateProxyClass(  Class<?> cl) throws IOException {
    annotateClass(cl);
  }
}
