public class CounterGrpcHelper {
  private static final Logger LOG=LoggerFactory.getLogger(CounterGrpcHelper.class);
  public static RpcServer rpcServer;
  public static void initGRpc(){
    if ("com.alipay.sofa.jraft.rpc.impl.GrpcRaftRpcFactory".equals(RpcFactoryHelper.rpcFactory().getClass().getName())) {
      RpcFactoryHelper.rpcFactory().registerProtobufSerializer(CounterOutter.GetValueRequest.class.getName(),CounterOutter.GetValueRequest.getDefaultInstance());
      RpcFactoryHelper.rpcFactory().registerProtobufSerializer(CounterOutter.IncrementAndGetRequest.class.getName(),CounterOutter.IncrementAndGetRequest.getDefaultInstance());
      RpcFactoryHelper.rpcFactory().registerProtobufSerializer(CounterOutter.ValueResponse.class.getName(),CounterOutter.ValueResponse.getDefaultInstance());
      try {
        Class<?> clazz=Class.forName("com.alipay.sofa.jraft.rpc.impl.MarshallerHelper");
        Method registerRespInstance=clazz.getMethod("registerRespInstance",String.class,Message.class);
        registerRespInstance.invoke(null,CounterOutter.GetValueRequest.class.getName(),CounterOutter.ValueResponse.getDefaultInstance());
        registerRespInstance.invoke(null,CounterOutter.IncrementAndGetRequest.class.getName(),CounterOutter.ValueResponse.getDefaultInstance());
      }
 catch (      Exception e) {
        LOG.error("Failed to init grpc server",e);
      }
    }
  }
  public static void setRpcServer(  RpcServer rpcServer){
    CounterGrpcHelper.rpcServer=rpcServer;
  }
  public static void blockUntilShutdown(){
    if (rpcServer == null) {
      return;
    }
    if ("com.alipay.sofa.jraft.rpc.impl.GrpcRaftRpcFactory".equals(RpcFactoryHelper.rpcFactory().getClass().getName())) {
      try {
        Method getServer=rpcServer.getClass().getMethod("getServer");
        Object grpcServer=getServer.invoke(rpcServer);
        Method shutdown=grpcServer.getClass().getMethod("shutdown");
        Method awaitTerminationLimit=grpcServer.getClass().getMethod("awaitTermination",long.class,TimeUnit.class);
        Runtime.getRuntime().addShutdownHook(new Thread(){
          @Override public void run(){
            try {
              shutdown.invoke(grpcServer);
              awaitTerminationLimit.invoke(grpcServer,30,TimeUnit.SECONDS);
            }
 catch (            Exception e) {
              e.printStackTrace(System.err);
            }
          }
        }
);
        Method awaitTermination=grpcServer.getClass().getMethod("awaitTermination");
        awaitTermination.invoke(grpcServer);
      }
 catch (      Exception e) {
        LOG.error("Failed to block grpc server",e);
      }
    }
  }
