 */
class BuildTimeTestSpringApplicationTests {
  @Test void runDoesNotRefreshContext(){
    BuildTimeTestSpringApplication application=newSpringApplication(TestConfiguration.class);
    GenericApplicationContext context=application.run();
    assertThat(context.isRunning()).isFalse();
    assertThat(context.getBeanDefinitionNames()).contains("buildTimeTestSpringApplicationTests.TestConfiguration").doesNotContain("sampleBean");
  }
  @Test void runWithDefaultSettings(){
    BuildTimeTestSpringApplication application=newSpringApplication(TestConfiguration.class);
    GenericApplicationContext context=application.run();
    assertThat(context.getBeanFactory()).isInstanceOfSatisfying(DefaultListableBeanFactory.class,(beanFactory) -> assertThat(beanFactory.isAllowBeanDefinitionOverriding()).isFalse());
    assertThat(context.getBeanFactoryPostProcessors()).noneSatisfy((bpp) -> assertThat(bpp).isInstanceOf(LazyInitializationBeanFactoryPostProcessor.class));
  }
  @Test void runPreserveCustomEnvironment(){
    BuildTimeTestSpringApplication application=newSpringApplication(TestConfiguration.class);
    MockEnvironment environment=new MockEnvironment();
    application.setEnvironment(environment);
    GenericApplicationContext context=application.run();
    assertThat(context.getEnvironment()).isSameAs(environment);
  }
  @Test void runSetAllowBeanDefinitionOverriding(){
    BuildTimeTestSpringApplication application=newSpringApplication(TestConfiguration.class);
    application.setAllowBeanDefinitionOverriding(true);
    GenericApplicationContext context=application.run();
    assertThat(context.getBeanFactory()).isInstanceOfSatisfying(DefaultListableBeanFactory.class,(beanFactory) -> assertThat(beanFactory.isAllowBeanDefinitionOverriding()).isTrue());
  }
  @Test void runSetLazyInitialization(){
    BuildTimeTestSpringApplication application=newSpringApplication(TestConfiguration.class);
    application.setLazyInitialization(true);
    GenericApplicationContext context=application.run();
    assertThat(context.getBeanFactoryPostProcessors()).anySatisfy((bpp) -> assertThat(bpp).isInstanceOf(LazyInitializationBeanFactoryPostProcessor.class));
  }
  @Test void runWithInvalidMainProperty(){
    BuildTimeTestSpringApplication application=newSpringApplication(TestConfiguration.class);
    application.setEnvironment(new MockEnvironment().withProperty("spring.main.web-application-type","INVALID_TYPE"));
    assertThatIllegalStateException().isThrownBy(application::run).withMessageContaining("Cannot bind to SpringApplication");
  }
  private BuildTimeTestSpringApplication newSpringApplication(  Class<?>... classes){
    BuildTimeTestSpringApplication application=new BuildTimeTestSpringApplication();
    application.addPrimarySources(Arrays.asList(classes));
    return application;
  }
@Configuration(proxyBeanMethods=false) static class TestConfiguration {
    @Bean String testBean(){
      return "test";
    }
  }
}
