/** 
 * Implements the matches operator. Matches takes two operands: The first is a String and the second is a Java regex. It will return  {@code true} when {@link #getValue} is calledif the first operand matches the regex.
 * @author Andy Clement
 * @author Juergen Hoeller
 * @since 3.0
 */
class OperatorMatches extends Operator {
  private final ConcurrentMap<String,Pattern> patternCache=new ConcurrentHashMap<String,Pattern>();
  public OperatorMatches(  int pos,  SpelNodeImpl... operands){
    super("matches",pos,operands);
  }
  /** 
 * Check the first operand matches the regex specified as the second operand.
 * @param state the expression state
 * @return {@code true} if the first operand matches the regex specified as thesecond operand, otherwise  {@code false}
 * @throws EvaluationException if there is a problem evaluating the expression(e.g. the regex is invalid)
 */
  @Override public BooleanTypedValue getValueInternal(  ExpressionState state) throws EvaluationException {
    SpelNodeImpl leftOp=getLeftOperand();
    SpelNodeImpl rightOp=getRightOperand();
    Object left=leftOp.getValue(state,String.class);
    Object right=getRightOperand().getValueInternal(state).getValue();
    if (!(left instanceof String)) {
      throw new SpelEvaluationException(leftOp.getStartPosition(),SpelMessage.INVALID_FIRST_OPERAND_FOR_MATCHES_OPERATOR,left);
    }
    if (!(right instanceof String)) {
      throw new SpelEvaluationException(rightOp.getStartPosition(),SpelMessage.INVALID_SECOND_OPERAND_FOR_MATCHES_OPERATOR,right);
    }
    try {
      String leftString=(String)left;
      String rightString=(String)right;
      Pattern pattern=this.patternCache.get(rightString);
      if (pattern == null) {
        pattern=Pattern.compile(rightString);
        this.patternCache.putIfAbsent(rightString,pattern);
      }
      Matcher matcher=pattern.matcher(leftString);
      return BooleanTypedValue.forValue(matcher.matches());
    }
 catch (    PatternSyntaxException ex) {
      throw new SpelEvaluationException(rightOp.getStartPosition(),ex,SpelMessage.INVALID_PATTERN,right);
    }
  }
}
