@Repository public class JdbcPetRepositoryImpl implements PetRepository {
  private NamedParameterJdbcTemplate namedParameterJdbcTemplate;
  private SimpleJdbcInsert insertPet;
  private OwnerRepository ownerRepository;
  private VisitRepository visitRepository;
  @Autowired public JdbcPetRepositoryImpl(  DataSource dataSource,  OwnerRepository ownerRepository,  VisitRepository visitRepository){
    this.namedParameterJdbcTemplate=new NamedParameterJdbcTemplate(dataSource);
    this.insertPet=new SimpleJdbcInsert(dataSource).withTableName("pets").usingGeneratedKeyColumns("id");
    this.ownerRepository=ownerRepository;
    this.visitRepository=visitRepository;
  }
  @Override public List<PetType> findPetTypes() throws DataAccessException {
    Map<String,Object> params=new HashMap<>();
    return this.namedParameterJdbcTemplate.query("SELECT id, name FROM types ORDER BY name",params,BeanPropertyRowMapper.newInstance(PetType.class));
  }
  @Override public Pet findById(  int id) throws DataAccessException {
    Integer ownerId;
    try {
      Map<String,Object> params=new HashMap<>();
      params.put("id",id);
      ownerId=this.namedParameterJdbcTemplate.queryForObject("SELECT owner_id FROM pets WHERE id=:id",params,Integer.class);
    }
 catch (    EmptyResultDataAccessException ex) {
      throw new DataRetrievalFailureException("Cannot find Pet: " + id);
    }
    Owner owner=this.ownerRepository.findById(ownerId);
    return EntityUtils.getById(owner.getPets(),Pet.class,id);
  }
  @Override public void save(  Pet pet) throws DataAccessException {
    if (pet.isNew()) {
      Number newKey=this.insertPet.executeAndReturnKey(createPetParameterSource(pet));
      pet.setId(newKey.intValue());
    }
 else {
      this.namedParameterJdbcTemplate.update("UPDATE pets SET name=:name, birth_date=:birth_date, type_id=:type_id, " + "owner_id=:owner_id WHERE id=:id",createPetParameterSource(pet));
    }
  }
  /** 
 * Creates a  {@link MapSqlParameterSource} based on data values from thesupplied  {@link Pet} instance.
 */
  private MapSqlParameterSource createPetParameterSource(  Pet pet){
    return new MapSqlParameterSource().addValue("id",pet.getId()).addValue("name",pet.getName()).addValue("birth_date",pet.getBirthDate()).addValue("type_id",pet.getType().getId()).addValue("owner_id",pet.getOwner().getId());
  }
}
