/** 
 * XSS 过滤 jackson 反序列化器。 在反序列化的过程中，会对字符串进行 XSS 过滤。
 * @author Hccake
 */
@Slf4j @AllArgsConstructor public class XssStringJsonDeserializer extends StringDeserializer {
  /** 
 * 属性
 */
  private final XssProperties properties;
  /** 
 * 路径匹配器
 */
  private final PathMatcher pathMatcher;
  private final XssCleaner xssCleaner;
  @Override public String deserialize(  JsonParser p,  DeserializationContext ctxt) throws IOException {
    HttpServletRequest request=ServletUtils.getRequest();
    if (request != null) {
      String uri=ServletUtils.getRequest().getRequestURI();
      if (properties.getExcludeUrls().stream().anyMatch(excludeUrl -> pathMatcher.match(excludeUrl,uri))) {
        return p.getText();
      }
    }
    if (p.hasToken(JsonToken.VALUE_STRING)) {
      return xssCleaner.clean(p.getText());
    }
    JsonToken t=p.currentToken();
    if (t == JsonToken.START_ARRAY) {
      return _deserializeFromArray(p,ctxt);
    }
    if (t == JsonToken.VALUE_EMBEDDED_OBJECT) {
      Object ob=p.getEmbeddedObject();
      if (ob == null) {
        return null;
      }
      if (ob instanceof byte[]) {
        return ctxt.getBase64Variant().encode((byte[])ob,false);
      }
      return ob.toString();
    }
    if (t == JsonToken.START_OBJECT) {
      return ctxt.extractScalarFromObject(p,this,_valueClass);
    }
    if (t.isScalarValue()) {
      String text=p.getValueAsString();
      return xssCleaner.clean(text);
    }
    return (String)ctxt.handleUnexpectedToken(_valueClass,p);
  }
}
