/** 
 * redisson分布式锁实现，基本锁功能的抽象实现 本接口能满足绝大部分的需求，高级的锁功能，请自行扩展或直接使用原生api https://gitbook.cn/gitchat/activity/5f02746f34b17609e14c7d5a
 * @author zlt
 * @date 2020/5/5<p> Blog: http://zlt2000.gitee.io Github: https://github.com/zlt2000
 */
@ConditionalOnClass(RedissonClient.class) @ConditionalOnProperty(prefix="zlt.lock",name="lockerType",havingValue="REDIS",matchIfMissing=true) @Component public class RedissonDistributedLock implements DistributedLock {
  @Autowired private RedissonClient redisson;
  private ZLock getLock(  String key,  boolean isFair){
    RLock lock;
    if (isFair) {
      lock=redisson.getFairLock(CommonConstant.LOCK_KEY_PREFIX + ":" + key);
    }
 else {
      lock=redisson.getLock(CommonConstant.LOCK_KEY_PREFIX + ":" + key);
    }
    return new ZLock(lock,this);
  }
  @Override public ZLock lock(  String key,  long leaseTime,  TimeUnit unit,  boolean isFair){
    ZLock zLock=getLock(key,isFair);
    RLock lock=(RLock)zLock.getLock();
    lock.lock(leaseTime,unit);
    return zLock;
  }
  @Override public ZLock tryLock(  String key,  long waitTime,  long leaseTime,  TimeUnit unit,  boolean isFair) throws InterruptedException {
    ZLock zLock=getLock(key,isFair);
    RLock lock=(RLock)zLock.getLock();
    if (lock.tryLock(waitTime,leaseTime,unit)) {
      return zLock;
    }
