    if (details) {
      builder=builder.flows(FlowUsage.of(flowRepository)).executions(ExecutionUsage.of(executionRepository,from,to)).services(ServiceUsage.of(from.toInstant(),to.toInstant(),serviceRepository,Duration.ofMinutes(5)));
