public final class RsEngine extends Engine {
  public static final String ENGINE_NAME="Rust";
  static final int RANK=4;
  private RsEngine(){
  }
  @SuppressWarnings("PMD.AvoidRethrowingException") static Engine newInstance(){
    try {
      LibUtils.checkStatus();
      return new RsEngine();
    }
 catch (    EngineException e) {
      throw e;
    }
catch (    Throwable t) {
      throw new EngineException("Failed to load Rust native library",t);
    }
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public Engine getAlternativeEngine(){
    return null;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public String getEngineName(){
    return ENGINE_NAME;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public int getRank(){
    return RANK;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public String getVersion(){
    return Engine.getDjlVersion();
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public boolean hasCapability(  String capability){
    if (StandardCapabilities.MKL.equals(capability)) {
      return true;
    }
 else     if (StandardCapabilities.CUDA.equals(capability)) {
      return RustLibrary.isCudaAvailable();
    }
    return false;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public Model newModel(  String name,  Device device){
    return new RsModel(name,device);
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public NDManager newBaseManager(){
    return RsNDManager.getSystemManager().newSubManager();
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public NDManager newBaseManager(  Device device){
    return RsNDManager.getSystemManager().newSubManager(device);
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public String toString(){
    StringBuilder sb=new StringBuilder(200);
    sb.append(getEngineName()).append(':').append(getVersion()).append(", ");
    sb.append(getEngineName()).append(':').append(getVersion()).append(", capabilities: [\n\t" + StandardCapabilities.MKL);
    if (hasCapability(StandardCapabilities.CUDA)) {
      sb.append(",\n\t").append(StandardCapabilities.CUDA);
    }
    sb.append(']');
    return sb.toString();
  }
}
