    this.batchifier=batchifier;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public Batchifier getBatchifier(){
    return batchifier;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public NDList processInput(  TranslatorContext ctx,  Input input) throws TranslateException {
    NDManager manager=ctx.getNDManager();
    try {
      ctx.setAttachment("properties",input.getProperties());
      return input.getDataAsNDList(manager);
    }
 catch (    IllegalArgumentException e) {
