/** 
 * This InstructionVisitor marks all methods that return with a non-empty stack (other than the return value).
 * @author Eric Lafortune
 */
public class NonEmptyStackReturnMarker implements InstructionVisitor {
  private final StackSizeComputer stackSizeComputer;
  /** 
 * Creates a new NonEmptyStackReturnMarker
 * @param stackSizeComputer the stack size computer that can return thestack sizes at the instructions that are visited.
 */
  public NonEmptyStackReturnMarker(  StackSizeComputer stackSizeComputer){
    this.stackSizeComputer=stackSizeComputer;
  }
  public void visitAnyInstruction(  Clazz clazz,  Method method,  CodeAttribute codeAttribute,  int offset,  Instruction instruction){
  }
  public void visitSimpleInstruction(  Clazz clazz,  Method method,  CodeAttribute codeAttribute,  int offset,  SimpleInstruction simpleInstruction){
switch (simpleInstruction.opcode) {
case Instruction.OP_LRETURN:
case Instruction.OP_DRETURN:
      markReturnWithNonEmptyStack(method,offset,2);
    break;
case Instruction.OP_IRETURN:
case Instruction.OP_FRETURN:
case Instruction.OP_ARETURN:
  markReturnWithNonEmptyStack(method,offset,1);
break;
case Instruction.OP_RETURN:
markReturnWithNonEmptyStack(method,offset,0);
break;
}
}
/** 
 * Marks the given method if the stack before the given instruction offset has a size larger than the given size.
 */
private void markReturnWithNonEmptyStack(Method method,int offset,int stackSize){
if (!stackSizeComputer.isReachable(offset) || stackSizeComputer.getStackSizeBefore(offset) > stackSize) {
setReturnsWithNonEmptyStack(method);
}
}
private static void setReturnsWithNonEmptyStack(Method method){
ProgramMethodOptimizationInfo.getProgramMethodOptimizationInfo(method).setReturnsWithNonEmptyStack();
}
public static boolean returnsWithNonEmptyStack(Method method){
return MethodOptimizationInfo.getMethodOptimizationInfo(method).returnsWithNonEmptyStack();
}
