private static class SocketInputStream extends InputStream {
  private final Selector selector;
  private final ByteBuffer buffer;
  private final SocketChannel socket;
  private final byte[] readBuffer=new byte[1];
  public SocketInputStream(  SocketChannel socket) throws IOException {
    this.socket=socket;
    selector=Selector.open();
    socket.register(selector,SelectionKey.OP_READ);
    buffer=ByteBuffer.allocateDirect(4096);
    BufferCaster.cast(buffer).limit(0);
  }
  @Override public int read() throws IOException {
    int nread=read(readBuffer,0,1);
    if (nread <= 0) {
      return nread;
    }
    return readBuffer[0] & 0xFF;
  }
  @Override public int read(  byte[] dest,  int offset,  int max) throws IOException {
    if (max == 0) {
      return 0;
    }
    if (buffer.remaining() == 0) {
      try {
        selector.select();
      }
 catch (      ClosedSelectorException e) {
        return -1;
      }
      if (!selector.isOpen()) {
        return -1;
      }
      BufferCaster.cast(buffer).clear();
      int nread;
      try {
        nread=socket.read(buffer);
      }
 catch (      IOException e) {
        if (isEndOfStream(e)) {
          BufferCaster.cast(buffer).position(0);
          BufferCaster.cast(buffer).limit(0);
          return -1;
        }
        throw e;
      }
      BufferCaster.cast(buffer).flip();
      if (nread < 0) {
        return -1;
      }
    }
    int count=Math.min(buffer.remaining(),max);
    buffer.get(dest,offset,count);
    return count;
  }
  @Override public void close() throws IOException {
    selector.close();
  }
}
