  public static DetectedObjects predict() throws IOException, ModelException, TranslateException {
    Path imageFile=Paths.get("src/test/resources/dog_bike_car.jpg");
    Image img=ImageFactory.getInstance().fromFile(imageFile);
    Criteria<Image,DetectedObjects> criteria=Criteria.builder().optApplication(Application.CV.OBJECT_DETECTION).setTypes(Image.class,DetectedObjects.class).optArgument("threshold",0.5).optEngine("PyTorch").optProgress(new ProgressBar()).build();
    try (ZooModel<Image,DetectedObjects> model=criteria.loadModel();Predictor<Image,DetectedObjects> predictor=model.newPredictor()){
      DetectedObjects detection=predictor.predict(img);
      saveBoundingBoxImage(img,detection);
      return detection;
    }
   }
  private static void saveBoundingBoxImage(  Image img,  DetectedObjects detection) throws IOException {
    Path outputDir=Paths.get("build/output");
    Files.createDirectories(outputDir);
    img.drawBoundingBoxes(detection);
    Path imagePath=outputDir.resolve("detected-dog_bike_car.png");
    img.save(Files.newOutputStream(imagePath),"png");
    logger.info("Detected objects image has been saved in: {}",imagePath);
  }
}
