 catch (    Exception ex) {
      log.error(String.format("定时任务执行异常 - id：%s，bean：%s，方法：%s，参数：%s ",id,beanName,methodName,params),ex);
    }
    long times=System.currentTimeMillis() - startTime;
    log.info("定时任务执行结束 - id：{}，bean：{}，方法：{}，参数：{}，耗时：{} 毫秒",id,beanName,methodName,params,times);
  }
  @Override public boolean equals(  Object o){
    if (this == o) {
      return true;
    }
    if (o == null || getClass() != o.getClass()) {
      return false;
    }
    SchedulingRunnable that=(SchedulingRunnable)o;
    if (params == null) {
      return id.equals(that.id) && beanName.equals(that.beanName) && methodName.equals(that.methodName)&& that.params == null;
    }
    return id.equals(that.id) && beanName.equals(that.beanName) && methodName.equals(that.methodName)&& params.equals(that.params);
  }
  @Override public int hashCode(){
    if (params == null) {
      return Objects.hash(id,beanName,methodName);
    }
    return Objects.hash(id,beanName,methodName,params);
  }
