@Order @Slf4j @Component public class QuickStartRunner implements ApplicationRunner {
  @Autowired private FlinkEnvService flinkEnvService;
  @Autowired private FlinkClusterService flinkClusterService;
  @Autowired private FlinkSqlService flinkSqlService;
  @Autowired private FlinkApplicationManageService applicationManageService;
  @Autowired private FlinkApplicationBuildPipelineService appBuildPipeService;
  private static final Long defaultId=100000L;
  @Override public void run(  ApplicationArguments args) throws Exception {
    Map<String,Map<String,String>> map=PropertiesUtils.extractMultipleArgumentsAsJava(args.getSourceArgs());
    Map<String,String> quickstart=map.get("quickstart");
    if (quickstart != null && quickstart.size() == 3) {
