private static class Multiset {
  private final int[] reg;
  private final int[] count;
  private int size;
  /** 
 * Constructs an instance.
 * @param maxSize the maximum distinct elements the set may have
 */
  public Multiset(  int maxSize){
    reg=new int[maxSize];
    count=new int[maxSize];
    size=0;
  }
  /** 
 * Adds an element to the set.
 * @param element element to add
 */
  public void add(  int element){
    for (int i=0; i < size; i++) {
      if (reg[i] == element) {
        count[i]++;
        return;
      }
    }
    reg[size]=element;
    count[size]=1;
    size++;
  }
  /** 
 * Searches the set for the element that has been added the most. In the case of a tie, the element that was added first is returned. Then, it clears the count on that element. The size of the set remains unchanged.
 * @return element with the highest count
 */
  public int getAndRemoveHighestCount(){
    int maxIndex=-1;
    int maxReg=-1;
    int maxCount=0;
    for (int i=0; i < size; i++) {
      if (maxCount < count[i]) {
        maxIndex=i;
        maxReg=reg[i];
        maxCount=count[i];
      }
    }
    count[maxIndex]=0;
    return maxReg;
  }
  /** 
 * Gets the number of distinct elements in the set.
 * @return size of the set
 */
  public int getSize(){
    return size;
  }
}
