  HookZzArm64RegisterContextImpl(  Emulator<?> emulator,  Stack<Object> context){
    super(context);
    this.reg_ctx=UnidbgPointer.register(emulator,Arm64Const.UC_ARM64_REG_X0).share(8);
    this.emulator=emulator;
  }
  @Override public UnidbgPointer getPointerArg(  int index){
    if (index < 8) {
      return getXPointer(index);
    }
    UnidbgPointer sp=getStackPointer();
    return sp.getPointer((long)(index - 8) * emulator.getPointerSize());
  }
  @Override public long getXLong(  int index){
    if (index >= 0 && index <= 28) {
      return reg_ctx.getLong(index * 8);
    }
    throw new IllegalArgumentException("invalid index: " + index);
  }
  @Override public int getXInt(  int index){
    return (int)getXLong(index);
  }
  @Override public UnidbgPointer getXPointer(  int index){
    return UnidbgPointer.pointer(emulator,getXLong(index));
  }
  @Override public long getFp(){
    return reg_ctx.getLong(29 * 8);
  }
  @Override public void setXLong(  int index,  long value){
    if (index >= 0 && index <= 28) {
      reg_ctx.setLong(index * 8,value);
    }
 else {
      throw new IllegalArgumentException("invalid index: " + index);
    }
  }
  @Override public void setStackPointer(  Pointer sp){
    throw new UnsupportedOperationException();
  }
  @Override public UnidbgPointer getFpPointer(){
    return UnidbgPointer.pointer(emulator,getFp());
  }
  @Override public long getLR(){
    return reg_ctx.getLong(30 * 8);
  }
  @Override public UnidbgPointer getLRPointer(){
    return UnidbgPointer.pointer(emulator,getLR());
  }
  @Override public UnidbgPointer getStackPointer(){
    return (UnidbgPointer)reg_ctx.share(30 * 8 + 8 + 16 * 8);
  }
