            pluginIntent.replaceExtras(extras);
          }
          startPluginActivity(context,installedPlugin,partKey,pluginIntent);
        }
 catch (        Exception e) {
          throw new RuntimeException(e);
        }
        if (callback != null) {
          callback.onCloseLoadingView();
        }
      }
    }
);
