public class PropsFilesScanner {
  private static final Logger logger=LoggerFactory.getLogger(PropsFilesScanner.class);
  public List<File> getPropsFiles(  String rootPath){
    logger.info("Start scanning for properties files. Root path = \"{}\"",rootPath);
    if (StringUtils.isBlank(rootPath)) {
      throw new PropsException("PRP0004",ErrorLevel.ERROR,CommonErrMsg.PropsLoaderErr,"Failed to  properties files because rootPath is empty");
    }
    List<File> files;
    try {
      files=(List<File>)FileUtils.listFiles(new File(rootPath),CliConstants.CONFIG_EXTENSION,false);
    }
 catch (    Exception e) {
      throw new PropsException("PRP0005",ErrorLevel.ERROR,CommonErrMsg.PropsLoaderErr,"Failed to list properties files",e);
    }
    if (files == null || files.size() == 0) {
      throw new PropsException("PRP0006",ErrorLevel.WARN,CommonErrMsg.PropsLoaderErr,"PropsFilesScanner has scanned 0 files given root " + rootPath);
    }
    logger.info("Scanned properties files=\"{}\"",files.toString());
    return files;
  }
  public List<PropertiesReader> getPropsReaders(  String rootPath){
    List<File> files=new PropsFilesScanner().getPropsFiles(rootPath);
    List<PropertiesReader> readersList=new ArrayList<>();
    for (int i=0; i < files.size(); i++) {
      String name=files.get(i).getName();
      String path=files.get(i).getAbsolutePath();
      PropertiesReader reader=new PropsFileReader();
      reader.setPropsId(name);
      reader.setPropsPath(path);
      readersList.add(reader);
    }
    return readersList;
  }
