/** 
 * Instruction format  {@code 21s}. See the instruction format spec for details.
 */
public final class Form21s extends InsnFormat {
  /** 
 * {@code non-null;} unique instance of this class 
 */
  public static final InsnFormat THE_ONE=new Form21s();
  /** 
 * Constructs an instance. This class is not publicly instantiable. Use  {@link #THE_ONE}.
 */
  private Form21s(){
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public String insnArgString(  DalvInsn insn){
    RegisterSpecList regs=insn.getRegisters();
    CstLiteralBits value=(CstLiteralBits)((CstInsn)insn).getConstant();
    return regs.get(0).regString() + ", " + literalBitsString(value);
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public String insnCommentString(  DalvInsn insn,  boolean noteIndices){
    CstLiteralBits value=(CstLiteralBits)((CstInsn)insn).getConstant();
    return literalBitsComment(value,16);
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public int codeSize(){
    return 2;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public boolean isCompatible(  DalvInsn insn){
    RegisterSpecList regs=insn.getRegisters();
    if (!((insn instanceof CstInsn) && (regs.size() == 1) && unsignedFitsInByte(regs.get(0).getReg()))) {
      return false;
    }
    CstInsn ci=(CstInsn)insn;
    Constant cst=ci.getConstant();
    if (!(cst instanceof CstLiteralBits)) {
      return false;
    }
    CstLiteralBits cb=(CstLiteralBits)cst;
    return cb.fitsInInt() && signedFitsInShort(cb.getIntBits());
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public BitSet compatibleRegs(  DalvInsn insn){
    RegisterSpecList regs=insn.getRegisters();
    BitSet bits=new BitSet(1);
    bits.set(0,unsignedFitsInByte(regs.get(0).getReg()));
    return bits;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public void writeTo(  AnnotatedOutput out,  DalvInsn insn){
    RegisterSpecList regs=insn.getRegisters();
    int value=((CstLiteralBits)((CstInsn)insn).getConstant()).getIntBits();
    write(out,opcodeUnit(insn,regs.get(0).getReg()),(short)value);
  }
}
