/** 
 * A helper to manage the state of the game at a moment in time. 
 */
private static final class State {
  int[] board;
  int turn;
  private State(  int[] board,  int turn){
    this.board=board;
    this.turn=turn;
  }
  private NDList getObservation(  NDManager manager){
    return new NDList(manager.create(board),manager.create(turn));
  }
  private ActionSpace getActionSpace(  NDManager manager){
    ActionSpace actionSpace=new ActionSpace();
    for (int i=0; i < 9; i++) {
      if (board[i] == 0) {
        actionSpace.add(new NDList(manager.create(i)));
      }
    }
    return actionSpace;
  }
  private boolean isDraw(){
    for (int i=0; i < 9; i++) {
      if (board[i] == 0) {
        return false;
      }
    }
    return true;
  }
  private int getWinner(){
    for (int i=0; i < 3; i++) {
      if (board[i] != 0 && board[i] == board[i + 3] && board[i] == board[i + 6]) {
        return board[i];
      }
    }
    for (int i=0; i < 9; i+=3) {
      if (board[i] != 0 && board[i] == board[i + 1] && board[i] == board[i + 2]) {
        return board[i];
      }
    }
    if (board[0] != 0 && board[0] == board[4] && board[0] == board[8]) {
      return board[0];
    }
    if (board[2] != 0 && board[2] == board[4] && board[2] == board[6]) {
      return board[2];
    }
    return 0;
  }
  /** 
 * {@inheritDoc} 
 */
  @Override public String toString(){
    StringBuilder s=new StringBuilder();
    for (int row=0; row < 3; row++) {
      for (int col=0; col < 3; col++) {
        int ind=3 * row + col;
        int val=board[ind];
        if (val == 0) {
          s.append(' ');
        }
 else         if (val == 1) {
          s.append('X');
        }
 else {
          s.append('O');
        }
        if (col < 2) {
          s.append('|');
        }
 else {
          s.append('\n');
        }
      }
      if (row < 2) {
        s.append("-----\n");
      }
    }
    if (getWinner() != 0) {
      s.append("Winner: ").append(getWinner()).append('\n');
    }
    return s.toString();
  }
}
