public class JWTAuthenticationFilter extends UsernamePasswordAuthenticationFilter {
  private final AuthenticationManager authenticationManager;
  private final long lifetime;
  private final String key;
  public JWTAuthenticationFilter(  AuthenticationManager authenticationManager,  long lifetime,  String key){
    this.authenticationManager=authenticationManager;
    this.lifetime=lifetime;
    this.key=key;
  }
  @Override public Authentication attemptAuthentication(  HttpServletRequest req,  HttpServletResponse res) throws AuthenticationException {
    try {
      UserCredentials credentials=new ObjectMapper().readValue(req.getInputStream(),UserCredentials.class);
      return authenticationManager.authenticate(new UsernamePasswordAuthenticationToken(credentials.getUsername(),credentials.getPassword(),new ArrayList<>()));
    }
 catch (    IOException e) {
      throw new InternalAuthenticationServiceException("Error processing credentials",e);
    }
  }
  @Override protected void successfulAuthentication(  HttpServletRequest req,  HttpServletResponse res,  FilterChain chain,  Authentication auth) throws IOException, ServletException {
    Date notBefore=new Date();
    Date expirationDate=new Date(notBefore.getTime() + lifetime);
    String token=Jwts.builder().setClaims(new HashMap<>()).setSubject(((User)auth.getPrincipal()).getUsername()).setNotBefore(notBefore).setExpiration(expirationDate).signWith(SignatureAlgorithm.HS512,key).compact();
    res.addHeader(WebSecurity.HeaderString,WebSecurity.TokenPrefix + token);
  }
