@Component @Aspect @Slf4j public class LogAspect {
  private final LogService logService;
  ThreadLocal<Long> currentTime=new ThreadLocal<>();
  public LogAspect(  LogService logService){
    this.logService=logService;
  }
  /** 
 * 配置切入点
 */
  @Pointcut("@annotation(com.platform.annotation.Log)") public void logPointcut(){
  }
  /** 
 * 配置环绕通知,使用在方法logPointcut()上注册的切入点
 * @param joinPoint join point for advice
 */
  @Around("logPointcut()") public Object logAround(  ProceedingJoinPoint joinPoint) throws Throwable {
    Object result;
    currentTime.set(System.currentTimeMillis());
    result=joinPoint.proceed();
    Log log=new Log("INFO",System.currentTimeMillis() - currentTime.get());
    currentTime.remove();
    HttpServletRequest request=(HttpServletRequest)RequestHolder.getHttpServletRequest();
    logService.save(getUsername(),StringUtils.getBrowser(request),StringUtils.getIp(request),joinPoint,log);
    return result;
  }
  /** 
 * 配置异常通知
 * @param joinPoint join point for advice
 * @param e exception
 */
  @AfterThrowing(pointcut="logPointcut()",throwing="e") public void logAfterThrowing(  JoinPoint joinPoint,  Throwable e){
    Log log=new Log("ERROR",System.currentTimeMillis() - currentTime.get());
    currentTime.remove();
    log.setExceptionDetail(ThrowableUtil.getStackTrace(e).getBytes());
    HttpServletRequest request=RequestHolder.getHttpServletRequest();
    logService.save(getUsername(),StringUtils.getBrowser(request),StringUtils.getIp(request),(ProceedingJoinPoint)joinPoint,log);
  }
  public String getUsername(){
    try {
      return SecurityUtils.getCurrentUsername();
    }
 catch (    Exception e) {
      return "";
    }
  }
