    NDArray mu=arrays.get(0);
    NDArray sigma=arrays.get(1);
    NDArray nu=arrays.get(2);
    mu=mu.squeeze(-1);
    sigma=sigma.getNDArrayInternal().softPlus().squeeze(-1);
    nu=nu.getNDArrayInternal().softPlus().add(2.).squeeze(-1);
    mu.setName("mu");
    sigma.setName("sigma");
    nu.setName("nu");
    return new NDList(mu,sigma,nu);
  }
  /** 
