/** 
 * Callable helper class used to collect the results of the parallel translation phase, adding the translated classes to the current dex file in correct (deterministic) file order. This class is also responsible for coordinating dex file rotation with the DirectClassFileConsumer class.
 */
private class ClassDefItemConsumer implements Callable<Boolean> {
  String name;
  Future<ClassDefItem> futureClazz;
  int maxMethodIdsInClass;
  int maxFieldIdsInClass;
  private ClassDefItemConsumer(  String name,  Future<ClassDefItem> futureClazz,  int maxMethodIdsInClass,  int maxFieldIdsInClass){
    this.name=name;
    this.futureClazz=futureClazz;
    this.maxMethodIdsInClass=maxMethodIdsInClass;
    this.maxFieldIdsInClass=maxFieldIdsInClass;
  }
  @Override public Boolean call() throws Exception {
    try {
      ClassDefItem clazz=futureClazz.get();
      if (clazz != null) {
        addClassToDex(clazz);
        updateStatus(true);
      }
      return true;
    }
 catch (    ExecutionException ex) {
      Throwable t=ex.getCause();
      throw (t instanceof Exception) ? (Exception)t : ex;
    }
 finally {
      if (args.multiDex) {
synchronized (dexRotationLock) {
          maxMethodIdsInProcess-=maxMethodIdsInClass;
          maxFieldIdsInProcess-=maxFieldIdsInClass;
          dexRotationLock.notifyAll();
        }
      }
    }
  }
}
