public class BatchResult<C> extends AbstractResult<C,Row> {
  private Logger LOG=LoggerFactory.getLogger(getClass());
  private final String accumulatorName;
  private final CollectBatchTableSink tableSink;
  private final Object resultLock;
  private AtomicReference<SqlExecutionException> executionException=new AtomicReference<>();
  private List<Row> resultTable;
  private boolean allResultRetrieved=false;
  public BatchResult(  TableSchema tableSchema,  RowTypeInfo outputType,  ExecutionConfig config){
    accumulatorName=new AbstractID().toString();
    tableSink=new CollectBatchTableSink(accumulatorName,outputType.createSerializer(config),tableSchema);
    resultLock=new Object();
  }
  @Override public void startRetrieval(  JobClient jobClient){
    CompletableFuture.completedFuture(jobClient).thenCompose(JobClient::getJobExecutionResult).thenAccept(new ResultRetrievalHandler()).whenComplete((unused,throwable) -> {
      if (throwable != null) {
        executionException.compareAndSet(null,new SqlExecutionException(ERROR_SUBMITTING_JOB.getErrorDesc(),throwable));
      }
    }
);
  }
  @Override public TypedResult<List<Row>> retrieveChanges() throws SqlExecutionException {
synchronized (resultLock) {
      SqlExecutionException e=executionException.get();
      if (e != null) {
        throw e;
      }
      if (null == resultTable) {
        return TypedResult.empty();
      }
      if (allResultRetrieved) {
        return TypedResult.endOfStream();
      }
 else {
        allResultRetrieved=true;
        return TypedResult.payload(resultTable);
      }
    }
  }
  @Override public TableSink<?> getTableSink(){
    return tableSink;
  }
  @Override public void close(){
  }
private class ResultRetrievalHandler implements Consumer<JobExecutionResult> {
    @Override public void accept(    JobExecutionResult jobExecutionResult){
      try {
        final ArrayList<byte[]> accResult=jobExecutionResult.getAccumulatorResult(accumulatorName);
        if (accResult == null) {
          throw new JobExecutionException(NOT_RETRIEVE_RESULT.getErrorDesc());
        }
        final List<Row> resultTable=SerializedListAccumulator.deserializeList(accResult,tableSink.getSerializer());
synchronized (resultLock) {
          BatchResult.this.resultTable=resultTable;
        }
        LOG.info("Accept the result, row is {}.",resultTable.size());
        getFlinkStatusListeners().forEach(listener -> listener.onSuccess(resultTable.size(),RowsType.Fetched()));
      }
 catch (      ClassNotFoundException|IOException|JobExecutionException e) {
        getFlinkStatusListeners().forEach(listener -> listener.onFailed("Serialization error while deserialize collected data.",e,RowsType.Fetched()));
        throw new RuntimeException("Serialization error while deserialize collected data.",e);
      }
    }
  }
}
